      nam
    }
  ]
  return (
    <div className="App">
      <BrowserRouter>
      <Header/>
       <Routes>
        <Route path='/' element={<Index/>}/>
        <Route path='/users' element={<Users/>}/>
        <Route path='/contact' element={<Contact/>}/> 
       </Routes>
      <Footer/>
      </BrowserRouter>
    </div>
  );
}

export default App;
